import { Bar,Doughnut,Line,Scatter,Radar,PolarArea } from "react-chartjs-2";

export const Dashboard = ({ chartDatas }) => {
  return (
    <div>
      <div>
      <Doughnut
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      </div>
      <Bar
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      <Line
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      <Scatter
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      <div>
      <Radar
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      </div>
      <div>
      <PolarArea
        data={chartDatas}
        options={{
          plugins: {
            title: {
              display: true,
              text: "Cryptocurrency prices"
            },
            legend: {
              display: true,
              position: "bottom"
           }
          }
        }}
      />
      </div>
    </div>
  );
};

export default Dashboard;
